script: |
  super -f text -I q5485.spq | sort > q5485.out

inputs:
  - name: q5485.spq
    data: |
      SELECT DISTINCT + 91 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT NULL BETWEEN ( + ( col0 ) + col2 * col1 ) AND - CAST ( NULL AS REAL ) * - col1;
  - name: tab1

outputs:
  - name: q5485.out
    data: |
